;NEWSPRITE_AREA		equ	0x2800
SPRITE_AREA			equ	0x3200		;area of sprite is 0x2800; add 0x400 padding
NEWSPRITE_AREA		equ	0x2800*SCALE_MULTIPLIER
SCALE_MULTIPLIER	equ 4

VGA_PAL_INDEX		equ	0x3C8
VGA_PAL_DATA		equ	0x3C9
;******************************************************************************
