gen_rand_num:
	push ax
	push es
	xor ax, ax
	mov es,ax
	mov ax, es:[46Ch] ;offset of var for internal timer in BPB
	mov [randtimer], al
	mov [randshiftnum], ah
	pop es
	pop ax
	cmp word [randtimer], 10
	jge gen_rand_shifts
	mov dx, ax
	shl dx, 1
	mov [randshift0], dx

