set_pal:
	salc				;set carry flag in al, if carry flag set, al=0
	mov	dx, VGA_PAL_INDEX	;
	out	dx, al
	inc	dx
	pal_1:
		push ax
		push cx
		or	ax, 0000111100110011b
		shr	ax, 10
		mov cl, [randshift0]
		xor al, cl
		out	dx, al
		mul	al
		mov cl, [randshift1]
		shl ax, cl
		shl	ax, 6
		out dx,al
		pop	cx
		pop	ax
		mov [crypt_key], ax
		out	dx,al
		inc	ax
		jnz	pal_1


